import React, { Component } from 'react';
import { Link, NavLink } from 'react-router-dom'
import { Redirect } from 'react-router'

class SignedInLinks extends Component {
    constructor(props) {
        super(props)
    }
    handleLogout = () => {
        localStorage.clear();

        <Redirect to="/signin" />

    }
    render() {
        if (props.isloggedin) {
            return (
                <div>Loggin</div>
            )
        }
        return (
            <ul className="dark">

                <li><NavLink to='/signin'>Home</NavLink></li>
                <li><NavLink to='/edit'>Edit Post</NavLink></li>
                <li><NavLink to='/show'>All Posts</NavLink></li>
                <li><NavLink to='/new'>New Post</NavLink></li>


            </ul>
        )
    }
}

export default SignedInLinks
